public void testToString() throws Exception {
  char[] b = {'a', 'l', 'o', 'h', 'a'};
  TermAttributeImpl t = new TermAttributeImpl();
  t.setTermBuffer(b, 0, 5);
  assertEquals("term=aloha", t.toString());

  t.setTermBuffer("hi there");
  assertEquals("term=hi there", t.toString());
}

